import React from "react";

const ForecastWeatherCard = (data) => {
    return(
        <div>
            <div></div>
            <div className="forecast-icon-text">
        <div className="forecast-icon">

        </div>
        <div className="forecast-text">
            {data.weather[0]}
        </div>
            </div>
            <div className="forecast-max-min" >
                <div className="max-temp">{Math.round(data.temp.max-273.15)}</div>
                <div className="min-temp">{Math.round(data.temp.min-273.15)}</div>
            </div>
            
        </div>
    )
        
    
};

export default ForecastWeatherCard;
